const body=document.getElementsByTagName("body")[0];var mediaQ=window.matchMedia("(min-width: 992px)"),headerSize=185;let limiter=100;function changeHeader(){const e=body.getElementsByClassName("header")[0],s=body.getElementsByClassName("home-header")[0];if(mediaQ.matches){const t=e.getElementsByTagName("img")[0];this.scrollTop>limiter?(e.style.zIndex="9999",t.src="/static/images/logo/logo_mobile.svg",e.classList.add("header-lg-show"),s.style.paddingTop=headerSize+"px"):(e.style.zIndex="auto",t.src="/static/images/logo/logo.svg",e.classList.remove("header-lg-show"),s.style.paddingTop="0px")}else e.style.zIndex="9999",e.style.position="sticky"}body.addEventListener("scroll",changeHeader);